import React from 'react';

class Zerodha extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="container">
                <img src="https://zerodha.com/static/images/landing.png"></img>
                <h1>Invest in everything</h1>
            </div>
        )
    }
}


export default Zerodha
